import { React } from "react";
import styled from "styled-components";
import hassan from "../img/32842 (1).jpg";
import hassan3 from "../img/hassan5.JPG";
import hassan4 from "../img/hassan4.JPG";
import { motion } from "framer-motion";
import {
  pageAnimation,
  Fade,
  photoAnim,
  LineAnim,
  slider,
  sliderContainer,
} from "../animation";
import { useScroll } from "../Components/useScroll";
import ScrollTop from "./../Components/ScrollTop";

const OurWork = () => {
  const [element, controls] = useScroll();
  const [element2, controls2] = useScroll();

  return (
    <Work
      style={{ background: "#fff" }}
      exit="exit"
      variants={pageAnimation}
      initial="hidden"
      animate="show"
    >
      <motion.div variants={sliderContainer}>
        <Frame1 variants={slider} />
        <Frame2 variants={slider} />
        <Frame3 variants={slider} />
        <Frame4 variants={slider} />
      </motion.div>
      <Movie>
        <motion.h2 className="head" variants={Fade}>
          Information Technology Army Officer
        </motion.h2>
        <motion.h2 className="armour" variants={Fade}>
          Egyptian Armed Forces | The Main Armor 101 Workshop
        </motion.h2>
        <motion.h6>
          2022 April – 2023 October
          <span>Hikestep, Cairo, Egypt</span>
        </motion.h6>
        <motion.div variants={LineAnim} className="line" />
        <motion.h3>
          During my tenure as a <span>Reserve Army Officer</span>, I held the positions of:
        </motion.h3>
        <motion.h5>
          <span>•</span> <span>Lieutenant</span> <u>2022 April</u> - <u>2022 December</u>
          <br />
          <span>•</span> <span>First Lieutenant</span> <u>2022 December</u> - <u>2023 October</u>
        </motion.h5>
        <Hide>
          <motion.img variants={photoAnim} src={hassan} alt="athlete" />
        </Hide>
      </Movie>

      <Movie ref={element} animate={controls}>
        <h3>
          🟢 Led a team in the IT Department, overseeing development and maintenance.
        </h3>
        <motion.div variants={LineAnim} className="line" />
        <img src={hassan3} alt="theracer" />
      </Movie>

      <Movie ref={element2} animate={controls2}>
        <h3>
          🟢 Solved complex database query problems in SQL.
        </h3>
        <motion.div variants={LineAnim} className="line" />
        <img src={hassan4} alt="goodtimes" />
      </Movie>

      <ScrollTop />
    </Work>
  );
};

const Work = styled(motion.div)`
  min-height: 100vh;
  overflow: hidden;
  padding: 5rem 10rem;

  @media (max-width: 768px) {
    padding: 2rem;
  }

  h2 {
    padding: 1rem 0;
  }
`;

const Movie = styled(motion.div)`
  padding-bottom: 1rem;
  
  .head, .armour {
    font-size: 4rem;
    text-align: center;
  }

  h6 {
    padding: 1rem 0;
    font-size: 1.5rem;
    text-align: center;
    span {
      display: block;
    }
  }

  h3, h5 {
    font-size: 2rem;
    text-align: center;
    color: black;
    padding-bottom: 1rem;
  }

  img {
    width: 100%;
    height: auto;
    max-height: 80vh;
    object-fit: cover;
  }

  @media (max-width: 768px) {
    .head, .armour {
      font-size: 2.5rem;
    }
    h3, h5 {
      font-size: 1.5rem;
    }
    h6 {
      font-size: 1.2rem;
    }
    img {
      max-height: 50vh;
    }
  }
`;

const Hide = styled.div`
  overflow: hidden;
`;

// Frame Animation
const Frame1 = styled(motion.div)`
  position: fixed;
  left: 0;
  top: 10%;
  width: 100%;
  height: 100vh;
  background: #fffebf;
  z-index: 2;
`;

const Frame2 = styled(Frame1)`
  background: #ff8efb;
`;

const Frame3 = styled(Frame1)`
  background: #8ed2ff;
`;

const Frame4 = styled(Frame1)`
  background: #8effa0;
`;

export default OurWork;
